	@Inject
	public LiTeLLabGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pModel = new ModelElements();
		this.pWeight = new WeightElements();
		this.pWInt = new WIntElements();
		this.pWFloat = new WFloatElements();
		this.pTempFormula = new TempFormulaElements();
		this.tOP2 = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.xtext.example.mydsl.LiTeLLab.OP2");
		this.tOPF = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.xtext.example.mydsl.LiTeLLab.OPF");
		this.tCOMP = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.xtext.example.mydsl.LiTeLLab.COMP");
		this.pTempTerm = new TempTermElements();
		this.pAP = new APElements();
		this.pVAR = new VARElements();
		this.pOldVAR = new OldVARElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.xtext.example.mydsl.LiTeLLab".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
